import React from 'react';

function Header() {
  return (
    <header>
      <h2>Рабійчук Дар'я Олександрівна</h2>
      <p>Дата народження: 9 грудня 2004 року, м. Київ</p>
      <p>Освіта: 233 СШ Оболонського району, НТУУ "КПІ"</p>
    </header>
  );
}

export default Header;
